import React from 'react'

function GrassGrid() {

  function createTable(rows,columns){
    const tableRows = [];
    for (let x = 0; x < rows; x++) {
      const rowCells = [];
  
      for (let y = 0; y < columns; y++) {
        rowCells.push(<td key={y}></td>);
      }
  
      tableRows.push(<tr key={x}>{rowCells}</tr>);
    }
    return (
      <table className="table">
        <tbody>
          {tableRows}
        </tbody>
      </table>
    );
  }

  return (
    <div>{createTable(5,3)}</div>
  )
}

export default GrassGrid
